		//פונקציה של גרירת התנינים
		function dragFunc(evt) {
			var p = stage.globalToLocal(stage.mouseX, stage.mouseY);
			evt.currentTarget.x = p.x;
			evt.currentTarget.y = p.y;
		}
		
		
		
		
		//הפונקציה שמתרחשת בעת שחרור התנין
		function release(evt) {
			var advatmaim = stage.getChildByName("Sign0");
			var AnsNum = parseInt(evt.currentTarget.name.slice(4));
			var theXsign = stage.getChildByName("XSign");
			var theBTN = stage.getChildByName("NextBtn");
			var Inst = stage.getChildByName("Instructions1");
			var inlar = stage.getChildByName("inlargeTxt");
			var WronsA = TheQuestions[mychoice - 1][qnum][4];
		
		
		
			if (intersect(evt.currentTarget, advatmaim)) {
				//מעלים את הליסנרים מהאובייקטים להשוואה
				for (var i = 0; i < 2; i++) {
					stage.getChildByName("Ob" + i).removeEventListener("click", Resize);
					stage.getChildByName("Ob" + i).cursor = "Default";
		
				}
		
				//מעלים את ההוראות
				Inst.alpha = 0;
				inlar.alpha = 0;
				//מנטרל את התנינים מכל פעולה	
				for (var i = 1; i < TheElements.length; i++) {
					stage.getChildByName("Sign" + i).removeEventListener("pressmove", dragFunc);
					stage.getChildByName("Sign" + i).removeEventListener("pressup", release);
					//מעביר את התנינים לאפור
					stage.getChildByName("Sign" + i).cursor = "Default";
					stage.getChildByName("Sign" + i).gotoAndStop(1);
		
		
				}
				//מחזיר את התנין שנבחר לירוק
				evt.currentTarget.gotoAndStop(0);
		
				//כאשר אני עוזב את העכבר התנין מקבל את המיקום של אדוות המים
				evt.currentTarget.x = advatmaim.x + 10;
				evt.currentTarget.y = advatmaim.y - 53;
				//הפונקציה שבודקת את התשובה הנכונה, היא מצליבה את מפתח התשובות למספר הסימן שנבחר
				if (AnsNum == TheQuestions[mychoice - 1][qnum][2]) {
					fScore += parseFloat(100 / (Qstamount * WronsA));
					//במידה והתשובה נכונה מופעל הטיקר
					dirtticker = setInterval(Dirtdispair, 50);
					//עצירת הטיקר של הזמן
					clearInterval(tickInt);
		
		
		
		
		
				} else {
					theXsign.alpha = 1;
					theBTN.alpha = 1;
					WronsA++;
					TheQuestions[mychoice - 1][qnum][4] = WronsA;
					//עצירת הטיקר של הזמן
					clearInterval(tickInt);
		
		
				}
			}
		}
		
		
		
		
		
		// תפקיד פונקציה זו הוא להעלים לכלוך במידה והמשתמש ענה תשובה נכונה ולגרום לכפתור להופיע תפקיד נוסף הוא בדיקת סיום המשחק 
		function Dirtdispair() {
			//משתנה עזר שתפקידו לעזור לי לתמרן את הופעת המשוב והכפתור וגם את עצירת הטיקר
			tickcount++;
			var theDirt = stage.getChildByName("dirt" + dnum);
			var theCsign = stage.getChildByName("VSign");
			var theBTN = stage.getChildByName("NextBtn");
			var theCsigX = stage.getChildByName("XSign");
			var Qclock = stage.getChildByName("thetime");
			var theqtxt = stage.getChildByName("theqplace");
			var rekka = stage.getChildByName("hareka");
			var horaot1 = stage.getChildByName("Instructions0");
			var horaot2 = stage.getChildByName("Instructions1");
			var inlargetext2 = stage.getChildByName("inlargeTxt");
		
			theDirt.alpha -= 0.1;
			//בגלל שהטיקר עובד בקצב 50 עשיתי משתנה שעוזר לי לחשוף את הוי וכפתור ההמשך רק לאחר זהלכלוך נעלם במלואו
			if (tickcount == 1) {
				var natznatz = new lib.starsDisappear();
				natznatz.name = "dirtdis";
				natznatz.x = theDirt.x;
				natznatz.y = theDirt.y;
				stage.addChild(natznatz);
		
			}
			//אם המשתנה שתפקידו לבדוק מתי הלכלוך נעלם שווה ל20  (זה אומר שנעלם הלכלוך)
			if (tickcount == 10) {
				//עוצר את אינטרוול העלמת הלכלוך
				clearInterval(dirtticker);
				//יצירה של אפקט הנצנוץ
				var natznatz1 = stage.getChildByName("dirtdis");
				stage.removeChild(natznatz1);
				//מגלה את סימון הוי
				theCsign.alpha = 1;
				//חושף את הכפתור
				theBTN.alpha = 1;
				//מאפס את משתנה בדיקת ההעלמות לקראת השאלה הבאה
				tickcount = 0;
				//מעלה את מספר התשובות הנכונות ב1
				dnum++;
				//מוריד את השאלה שנענתה מהמערך
				TheQuestions[mychoice - 1].splice(qnum, 1);
				//בדיקה האם נגמר המשחק
				if (TheQuestions[mychoice - 1].length == 0) {
					//מסיר את תניני ההשוואה
					for (var i = 0; i < TheElements.length; i++) {
						var Csign = stage.getChildByName("Sign" + i);
						stage.removeChild(Csign);
		
		
					}
					//מסיר את פריטי ההשוואה
					for (var i = 0; i < 2; i++) {
						var Celements = stage.getChildByName("Ob" + i);
						stage.removeChild(Celements);
		
		
					}
					//מסיר את הלכלוכים הישנים
					for (var i = 0; i < Qstamount; i++) {
						var Dsign = stage.getChildByName("dirt" + i);
						stage.removeChild(Dsign);
		
					}
		
		
		
		
					//מסיר את הכפתור השעון, את  סימני המשוב, את ההוראות, הכפתורים והשעון
					stage.removeChild(theBTN);
					stage.removeChild(theCsign);
					stage.removeChild(theCsigX);
					stage.removeChild(Qclock);
					stage.removeChild(theqtxt);
					stage.removeChild(rekka);
					stage.removeChild(horaot1);
					stage.removeChild(horaot2);
					stage.removeChild(inlargetext2);
					//יוצר את אנימציית הסיום
					var endA = new lib.endA();
					endA.name = "endAnimation";
					endA.y = 450;
					endA.x = 480;
					stage.addChild(endA);
					//אחרי 6 שניות של אנימציית הסיום
					EndTick = setInterval(Endsession, 6000);
		
		
				}
		
		
			}
		}
		
